	return (
		<ProductListWrapper>
			{products.map((product): any => (
				<CardProduct key={product.vendorСode}>
					<Product product={product} />
					{console.log(product)}
				</CardProduct>
			))}
		</ProductListWrapper>
	);
};

export default ProductList;
